import React from "react";

const Card = () => {
  return (
    <div>
      <div className="card">
        <div className="card-background-top"></div>
        <div className="card-info">
          <div className="name">
            <h1>Isaac Arnold</h1>
            <h2>Brisbane</h2>
          </div>
          <div className="stats">
            <div className="stat-info">
              <p>80K</p>
              <p>Followers</p>
            </div>
          </div>
        </div>
      </div>
      <p>This is working</p>
    </div>
  );
};

export default Card;
